import React, { useEffect, useState } from "react";

const Links = (props) => {
  const [list, setList] = useState([]);
  useEffect(() => {
    setList((prev) => [...prev, props.record]);
  }, [setList]);
  console.log(props);
  const toLink = (link) => {
    document.location.href = link;
  };
  console.log(list);
  return (
    <div
      style={{
        width: 200,
        height: 300,
        position: "absolute",
        backgroundColor: "red",
        right: 0,
        zIndex: 999,
      }}
    >
      <div onClick={() => toLink(props.record)}>
        <a>{props.record}</a>
      </div>
    </div>
  );
};

export default Links;
